import { Mail, Home } from 'react-feather'

export default [
  {
        id: 'home',
        title: 'Home',
        icon: <Home size = { 20 }/>,
        navLink: '/home'
    },
    {
        id: 'secondPage',
        title: 'Second Page',
        icon: <Mail size = { 20 }/>,
        navLink: '/second-page'
    },
    {
        id: 'sgsoil',
        title: 'Sand and Soil',
        title2:'Transportation Permits',
        icon: <Mail size = { 20 }/>,
        navLink: '/sgsoil'
    },
    {
      id: 'timwood',
      title: 'Timber and Wood',
      title2: 'Transportation Permits',
      icon: <Mail size = { 20 }/>,
      navLink: '/timwood'
  },
  {
    id: 'timwoodHistory',
    title: 'Timber and Wood',
    title2: 'Transportation Permits History',
    icon: <Mail size = { 20 }/>,
    navLink: '/timwoodHistory'
   }
]
